import React, { useEffect, useState } from 'react'

const Login = () => {

  const [test, setTest] = useState<[number]>([1])

    const sum = (a : number, b : number) : number => {
        return a + b
    }

  return (
    <div>
        <p>login : {sum(5, 10)}</p>
        <p onClick={() => {
          setTest(test + 1)
        }}>{test}</p>
    </div>
  )
}

export default Login
